import React from 'react'
import { Layout } from 'antd';

export default function MainLayout(props) {
    const { Header, Footer, Sider, Content } = Layout;
    return (
        <Layout>
            <Header>Header</Header>
            <Sider>Sider</Sider>
            <Layout>
                <Content>{props.children}</Content>
            </Layout>
            <Footer>Footer</Footer>
        </Layout>
    )
}
